import React, { Component } from "react";
import { connect } from "react-redux";
import { MDBTable, MDBTableBody, MDBTableHead } from "mdbreact";

export class meetingslist extends Component {
  render() {
    return (
      <div className="bg">
        <MDBTable responsive>
          <MDBTableHead>
            <tr>
              <th>#</th>
              <th>Salon</th>
              <th>Type prestation</th>
              <th>Heure</th>
              <th>Date</th>
              <th>Status</th>
              <th>Supprimé</th>
            </tr>
          </MDBTableHead>
          <MDBTableBody>
            <tr>
              <td>1</td>
              <td>Salon Khaled beauté </td>
              <td>Coupe barbe</td>
              <td>18:00</td>
              <td>12/12/2020</td>
              <td>Confirmé</td>
              <td>Cell</td>
            </tr>
          </MDBTableBody>
        </MDBTable>
      </div>
    );
  }
}

const mapStateToProps = (state) => ({});

const mapDispatchToProps = {};

export default connect(mapStateToProps, mapDispatchToProps)(meetingslist);
